    assert np.all(X > 0)
    X[:, 0] = np.log(X[:, 0])
    X_mins = X.min(axis=0)
    X_maxs = X.max(axis=0)
    X_scaled = (X - X_mins) / (X_maxs - X_mins)
    return X_scaled, X_mins, X_maxs

