import numpy as np

def initialize_centroids(X, k):
    """Randomly select k unique data points as initial cluster centers."""
    # fix the random seed
    np.random.seed(10)
    indices = np.random.choice(X.shape[0], size=k, replace=False)
    return X[indices]

def compute_centroids(X, labels, k):
    """Calculate new cluster centers based on the current labels."""
    # TASK1-TODO: YOUR CODE HERE
    centroids = np.zeros((k, X.shape[1]))

    for i in range(k):
      members = X[labels == i]
      if len(members) > 0:
        centroids[i] = np.mean(members, axis=0)

    return centroids

# Merge and Split functions
def merge_clusters(centroids, merge_threshold):
    """Merge clusters whose distance is less than merge_threshold."""
    distances = np.linalg.norm(centroids[:, np.newaxis] - centroids[np.newaxis, :], axis=2)
    to_merge = np.where(distances < merge_threshold)
    merged_centroids = [] # Used to store the newly merged cluster centers
    merged_labels = [] # Used to track the cluster centers that have been merged

    for i in range(len(centroids)):
        if i not in merged_labels:
            # TASK2-TODO: YOUR CODE HERE
            # Get indices of all merge candidates by threshold including i
            merge_indices = to_merge[1][to_merge[0]==i]
            # Remove the ones that are in merged_labels
            others = merge_indices[~np.isin(merge_indices, merged_labels)]

            if len(others[others != i]) > 0:
                first = merge_indices[:2]
                new_centroid = np.mean(centroids[first], axis=0)
                if len(merge_indices) > 2:
                  # When need to merge many, update the position of new centroid combining the previous one by one
                  for j in range(2, len(merge_indices)):
                      combined = np.vstack([new_centroid, centroids[merge_indices[j]]])
                      new_centroid = np.mean(combined, axis=0)
                merged_centroids.append(new_centroid)
            else:
              merged_centroids.append(centroids[i])

            merged_labels.extend(merge_indices)

    return np.array(merged_centroids)

def split_cluster(X, labels, cluster_idx, split_threshold):
    """If the number of samples in a cluster exceeds split_threshold, a split is performed."""
    cluster_points = X[labels == cluster_idx]
    # TASK3-TODO: YOUR CODE HERE
    if len(cluster_points) > split_threshold:
      # return np.vstack([cluster_points[0], cluster_points[split_threshold]])
      # return np.vstack([np.mean(cluster_points[0:split_threshold], axis=0), np.mean(cluster_points[split_threshold:], axis=0)])
      return initialize_centroids(cluster_points, 2)

    return None

